Property.Value:
BEGIN
	declare @idPopravka int;
	declare @id int;

	select @idPopravka= i.Sifra_usluge from inserted i;
	select @id = max(Sifra_radnika) FROM Majstor;
		INSERT INTO Radi_popravka(Popravka_Sifra_usluge,Majstor_Sifra_radnika) VALUES (@idPopravka,@id);
END

BEGIN
declare @return_value as decimal;
	select @return_value = count(sifra_alata)  from Alat inner join Koristi on Alat.Sifra_alata=Koristi.Alat_Sifra_alata;
	RETURN @return_value
END
